import React from 'react'
import Navbar from '../components/Navbar';


export default function work() {
  return (
    <React.Fragment>
            <style jsx>{`
        * {
          font-family: 'Roboto', sans-serif;
        }
        body{
            margin:0;
            padding:10px 50px;
        }
      `}</style>
    <head>
        <link href="https://fonts.googleapis.com/css?family=Roboto" rel="stylesheet"></link>
    </head>
    <body>
        <Navbar />
        work
    </body>

    </React.Fragment>
  )
}
